import React from 'react';

const Input = props => {
	return(
		<div className="form-group">
	    <input 
			className='has-error form-control ' 
	    	type={props.type}
	    	id={props.id} 
	    	placeholder={props.placeholder} 
	    	onChange={props.handleChange} 
	    	value={props.value}
	    	required
	    />
     </div>
		)
}

export default Input;
